def find_Rotations(s):
    n = len(s)
    if n % 2 == 0:
        first_half = s[:n//2]
        second_half = s[n//2:]

        if first_half == second_half:
            return 1
        for i in range(n//2, 1, -1):
            rotated = s[i:] + s[:i]
            if rotated == s:
                return n//i
    return n

