def eulerian_num(n, m):
    dp = [[0] * (m + 1) for i in range(n + 1)]
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            if i < j:
                dp[i][j] = 0
            elif j == 1:
                dp[i][j] = i + 1
            else:
                dp[i][j] = (j + 1) * dp[i - 1][j] - j * dp[i - 2][j]

    return dp[n][m]

