def extract_missing(ranges, start, end):
    result = []

    # Sort the list of ranges
    ranges.sort()

    # Add the missing range from start to the first range
    if start < ranges[0][0]:
        result.append((start, ranges[0][0]))

    # Find and add missing ranges between existing ranges
    for i in range(len(ranges) - 1):
        if ranges[i][1] < ranges[i+1][0]:
            result.append((ranges[i][1], ranges[i+1][0]))

    # Add the missing range from the last range to end
    if ranges[-1][1] < end:
        result.append((ranges[-1][1], end))

    return result

