def solution(a, b, n):
    # Find the greatest common divisor
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    d = gcd(a, b)

    # Check if n is divisible by gcd
    if n % d != 0:
        return 'No solution'

    # Find x and y using Extended Euclidean Algorithm
    x, y = 0, 0

    for i in range(abs(a), n+1, abs(b)):
        if (n - a*i) % b == 0:
            x = i
            y = (n - a*i) // b
            break

    if a < 0:
        x = -x
    if b < 0:
        y = -y

    return ('x = ', x, ', y = ', y)

