    # Create 2 lists for growing from left and right respectively
    inc = [0] * n
    dec = [0] * n
    # Calculate increasing sub-sequence
    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[i] > arr[j] and inc[i] < inc[j] + arr[i]:
                inc[i] = inc[j] + arr[i]
    # Calculate decreasing sub-sequence
    for i in range(n-1, -1, -1):
        dec[i] = arr[i]
        for j in range(i+1, n):
            if arr[i] > arr[j] and dec[i] < dec[j] + arr[i]:
                dec[i] = dec[j] + arr[i]
    # Total maximum sum
    maximum = inc[0] + dec[0] - arr[0]
    for i in range(1, n):
        maximum = max(maximum, inc[i] + dec[i] - arr[i])
    return maximum

