    def is_prime(x):
        if x < 2:
            return False
        for i in range(2, int(x ** 0.5) + 1):
            if x % i == 0:
                return False
        return True

    def generate_primes():
        num = 1
        while True:
            num += 1
            if is_prime(num):
                yield num

    primes = generate_primes()
    ns = [next(primes) for _ in range(2 ** n) if _ > 0]
    return ns[-1] + 1

