def is_subset_sum(arr, n, target):
    # The value of the i-th element of the dp list will be True if there is a 
    # subset of the list from 0 to i-1 with the target sum, otherwise False. 
    dp = [[False for i in range(target + 1)] for j in range(n + 1)] 
  
    # If the target sum is 0 
    for i in range(0, n + 1): 
        dp[i][0] = True
  
    # If the list is empty 
    for i in range(1, target + 1): 
        dp[0][i] = False
  
    for i in range(1, n + 1): 
        for j in range(1, target + 1): 
            dp[i][j] = dp[i - 1][j] 
  
            if arr[i - 1] <= j: 
